import React, { Component } from 'react';
import Form from './components/form';

class App extends Component {
  state = {
      he: 'Track Bills'
    }


  render() {

    return (
      <div>
        <h1 className='text-center'>{this.state.he}</h1>
        <Form />
      </div>
    );
  }
}

export default App;
